When using euca-describe-keypairs with a non-existent keypair name, euca-describe-keypairs returns no error.  

{code}
[root@viking-01 ~]# euca-describe-keypairs money
[root@viking-01 ~]#
{code}

When testing this with AWS, we should return InvalidKeyPair.NotFound.

{code}
$ ec2-describe-keypairs money
Client.InvalidKeyPair.NotFound: The key pair 'money' does not exist
{code}

*Reference*

* http://docs.aws.amazon.com/AWSEC2/latest/APIReference/api-error-codes.html ( reference InvalidKeyPair.NotFound )
